function App() {
    //state
    const [isConnected, setIsConnected] =  useState(false);
    const [isAdmin, setIsAdmin] =  useState(true);


    //comportement

    //render
    return (
      <div>
        <Navbar isConnected ={isConnected} isAdmin={isAdmin}  />
        <ConnexionInscription />

      </div>
    );
}





export default App;
